    struct heap_block *prev;
    bool free;
} heap_block_t;

static heap_block_t *g_heap_head = NULL;
static heap_block_t *g_heap_tail = NULL;

#ifdef ENABLE_USER_MEM_DEBUG_LOGS
static void user_heap_log(const char *msg, uintptr_t value)
{
